new(false)); let released = Rc::new(Cell::new(false)); let _button = button::Listener::new(0, { let pressed = pressed.clone(); let released = released.clone(); move |state| match state { button::Pressed => pressed.set(true), button::Released if pressed.get() => released.set(true), button::Released => (), } })?; We then wait until the button is pressed using scheduling::wait_until(). This function takes a condition as argument and only executes callbacks until the condition is satisfied. // Wait for the button to be pressed. scheduling::wait_until(|| pressed.get()); According to the specification of this example applet, when the button is pressed we must turn on the LED (and stop blinking if we were blinking) to signal a possible short press. Note that callbacks can only executed when a scheduling function is called, so we are essentially in a critical section. As such, the order in which we do those 3 lines doesn't matter. However, a callback might be scheduled before we stop the blink timer. It will execute next time we call a scheduling function. This is ok because when that will happen, the blinking state will be false and the blink handler will do nothing. // Turn the LED on. blink.stop(); blinking.set(false); led::set(0, led::On); To detect a long press, we need to start a timer. There is nothing new here except the Timer::start() function which takes the timer mode (one-shot or periodic) and its duration. // Start the timeout to decide between short and long press. let timed_out = Rc::new(Cell::new(false)); let timer = timer::Timer::new({ let timed_out = timed_out.clone(); move || timed_out.set(true) }); timer.start(timer::Oneshot, Duration::from_secs(1)); We now wait for the first event between the button being released and the timeout firing. This is simply done by using a condition which is a disjunction of the events of interest. This is a common pattern when implementing behavior with a timeout. // Wait for the button to be released or the timeout to fire. scheduling::wait_until(|| released.get() || timed_out.get()); To signal that the timeout was reached or the button was released, we turn off the LED. // Turn the LED off. led::set(0, led::Off); Finally, if the press was short (i.e. the button was released before the timeout), we start blinking. This demonstrates the use of periodic timers. // Start blinking if short press. if !timed_out.get() { blinking.set(true); blink.start(timer::Periodic, Duration::from_millis(200)); } There are a few things to note: The code is implicit in Rust, but the button handler and the timer handler within the loop iteration are dropped before the next iteration. This means that their callbacks are unregistered. This could be done explicitly by calling core::mem::drop() on their variable if needed. It is not needed to start and stop the blink timer within the loop as long as it is started before entering the loop. This is just an optimization to avoid calling the handler when we know that the blinking shared state is false, because the handler would do nothing in that case. The final code looks like this: #![no_std]
