We provide a buffer with the length of the current level. For the string to be printable we truncate the entropy of each byte from 8 to 5 bits and convert it to a base32 symbol. // Generate a question for this level. let mut question = vec![0; level]; rng::fill_bytes(&mut question).unwrap(); for byte in &mut question { const BASE32: [u8; 32] = *b"ABCDEFGHIJKLMNOPQRSTUVWXYZ234567"; *byte = BASE32[(*byte & 0x1f) as usize]; } let mut question = String::from_utf8(question).unwrap(); We can now show the question to the player. We do so using a process helper function that we will also use for the answer. We instantiate this function such that the player has 3 seconds to memorize the question and may hit Enter at any time to start answering. // Display the question. process(3, "Memorize this", &mut question, |_, x| x == 0x0d); After 3 seconds have elapsed or if the player hit Enter, we read the answer from the player. We give them 7 seconds to type the answer. We also convert lower-case letters to upper-case for convenience (it's easier to read upper-case but easier to type lower-case). We also support backspace which the terminal sends as 0x7f. And same as for the question, we let the player exit early with Enter to avoid waiting until the timeout. // Read the answer. let mut answer = String::new(); process(7, "Type what you remember", &mut answer, |answer, byte| { match byte { b'A' ..= b'Z' | b'2' ..= b'7' => answer.push(byte as char), b'a' ..= b'z' => answer.push(byte.to_ascii_uppercase() as char), 0x7f => drop(answer.pop()), 0x0d => return true, _ => (), } false }); Once we have the answer, we check if it matches the question. If it does, we promote the player to the next level. If it doesn't, we demote the player to the previous level. However, if there are no previous level because the player is at level 1, then we let them retry the level to show our support. We use ANSI escape codes to highlight the result. // Check the answer. if answer == question { level += 1; 