For now only a key-value store is supported for persistent storage. Eventually, additional facilities may be added: a cyclic logging journal, a file-system, raw flash access, etc. In this section, we will illustrate the key-value store usage by walking through the store example which provides direct store access through USB serial. We first define a helper to write a line to the USB serial. fn writeln(buf: &[u8]) { serial::write_all(&UsbSerial, buf).unwrap(); serial::write_all(&UsbSerial, b"\r\n").unwrap();
} Because values may be at most 1023 bytes, there is a system to store large entries as multiple fragments of at most 1023 bytes each using multiple keys. To support those large entries, we define an abstract notion of keys. An abstract key is either exactly one key, or a contiguous range of keys. enum Key { Exact(usize), Range(Range<usize>),
} We then define helpers to dispatch to the regular or fragmented version based on the abstract key. The insert, find, and remove functions will be explained later. fn insert(key: &Key, value: &[u8]) -> Result<(), Error> { match key { Key::Exact(key) => store::insert(*key, value), Key::Range(keys) => store::fragment::insert(keys.clone(), value), }
} fn find(key: &Key) -> Result<Option<Box<[u8]>>, Error> { match key { Key::Exact(key) => store::find(*key), Key::Range(keys) => store::fragment::find(keys.clone()), }
} fn remove(key: &Key) -> Result<(), Error> { match key { Key::Exact(key) => store::remove(*key), Key::Range(keys) => store::fragment::remove(keys.clone()), }
} The first thing we do when the applet starts is print a short help describing how to use the applet. fn main() { writeln(b"Usage: insert <key>[..<key>] <value>"); writeln(b"Usage: find <key>[..<key>]"); writeln(b"Usage: remove <key>[..<key>]"); We can then start the infinite loop processing exactly one command per iteration. loop { We start a loop iteration by reading a command from the user. Only space, lower-case alphabetic characters, digits, and backspace are supported. We exit as soon as the user hits Enter. // Read the command. let mut command = String::new(); loop { serial::write_all(&UsbSerial, format!("\r\x1b[K> {command}").as_bytes()).unwrap(); match serial::read_byte(&UsbSerial).unwrap() { c @ (b' ' | b'.' | b'a' ..= b'z' | b'0' ..= b'9') => command.push(c as char), 0x7f => drop(command.pop()), 0x0d => break, _ => (), } } serial::write_all(&UsbSerial, b"\r\n").unwrap(); We then parse the command (described later). If the command is invalid, we print a message and continue to the next loop iteration. // Parse the command. let command = match Command::parse(&command) { Some(x) => x, None => { writeln(b"Failed: InvalidCommand"); continue; } }; And we finally process the command (described later). If processing failed, we print a message with the error. Regardless of error, this is the end of the loop (and thus the main function) and we continue to the next iteration. // Process the command. if let Err(error) = command.process() { writeln(format!("Failed: {error:?}").as_bytes()); } To ease parsing and processing, we define a straightforward type for commands. enum Command<'a> { Insert { key: Key, value: &'a str }, Find { key: Key }, Remove { key: Key },
